import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

let name = 'Ryan'
let green = '#ff1212'
let headerStyle = { color: green, 'font-size': '50px' }

class Aggregate extends Component {
  render() {
    return (
      <div style={{width: '40%', display: 'inline-block'}}>
        <h2 style={{color: '#ccc'}}>Number Text</h2>
      </div>
    )
  }
}

class Filter extends Component {
  render(){
    return(
      <div>
        <img/>
        <input type='text'/>
      </div>
    )
  }
}

function App() {


  return (
    <div className="App">
      <h1 >Title</h1>
      <Aggregate />
      <Aggregate />
      <Filter/>

    </div>
  );
}

export default App;
